DROP FUNCTION IF EXISTS `getCustPort`;
DELIMITER ;;
CREATE DEFINER=`DB_USER066`@`%` FUNCTION `getCustPort`(cname varchar(50)) RETURNS varchar(200) CHARSET utf8mb4
    READS SQL DATA
begin
		declare result varchar(200);
	  select portrait into result
	  from customer
		where `username` = cname;
		return result;
	end
;;
DELIMITER ;

-- ----------------------------
-- Function structure for get_biggest_evaluate_id
-- ----------------------------
DROP FUNCTION IF EXISTS `get_biggest_evaluate_id`;
DELIMITER ;;
CREATE DEFINER=`DB_USER066`@`%` FUNCTION `get_biggest_evaluate_id`() RETURNS int(11)
    READS SQL DATA
BEGIN
	declare result int;
    declare cnt int;
    select count(*) into cnt from `evaluate`;
    if cnt = 0 then
    	return 1;
    else
    	select `evaluate_id` into result
        from `evaluate`
        order by `evaluate_id` desc
        limit 1;
    	return result+1;
   	end if;
	RETURN 0;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for get_biggest_order_id
-- ----------------------------
DROP FUNCTION IF EXISTS `get_biggest_order_id`;
DELIMITER ;;
CREATE DEFINER=`DB_USER066`@`%` FUNCTION `get_biggest_order_id`() RETURNS int(11)
    READS SQL DATA
BEGIN
	declare result int;
    declare cnt int;
    select count(*) into cnt from `order`;
    if cnt = 0 then
    	return 1;
    else
    	select `order_id` into result
        from `order`
        order by `order_id` desc
        limit 1;
    	return result+1;
   	end if;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for sumMoney
-- ----------------------------
DROP FUNCTION IF EXISTS `sumMoney`;
DELIMITER ;;
CREATE DEFINER=`DB_USER066`@`%` FUNCTION `sumMoney`(orderId int) RETURNS int(11)
    READS SQL DATA
begin
		declare result int;
	  select sum(`product`.price*`sell`.count) into result
		from `sell` inner join `product`
		on `sell`.product_id = `product`.product_id
		where `sell`.order_id = orderId;
		return result;
	end
;;
DELIMITER ;
